import { Container } from 'react-bootstrap';

function ImgContainer() {
    return (
        <Container>
            <div className='d-flex flex-wrap justify-content-center box-container' id="img_container">
                <div className='box'><a target='_blank'> <img className='img-fluid' alt='random image' ></img> </a> </div>
            </div>
        </Container>
    );
};

export default ImgContainer;

